script: |
  super -f text -I q11697.spq | sort > q11697.out

inputs:
  - name: q11697.spq
    data: |
      SELECT + col2 + + ( + 10 - + col1 ) AS col2 FROM tab2 (FORMAT parquet) WHERE NOT col2 IN ( + col1 * 23 );
  - name: tab2

outputs:
  - name: q11697.out
    data: |
      -18
      -27
      1
